import Taskinput from './components/Taskinput';
import Tasklist from './components/Tasklist';
import './App.css'; // Assuming you have an App.css file for styling

function App() {
  return (
    <div className="App">
      <div className="Head">
        <h1>To-Do Application</h1>
      </div>
      <div className="TodoApp">
        <Taskinput />
        <Tasklist />
      </div>
    </div>
  );
}

export default App;
